08:47 AM; Case called for Plea/sentencing hearing.  Defendant Benjamin J. Neumann in court with attorney Craig Michael Kuhary.  Christian Farina appeared for the State of Wisconsin.  Court notes a plea questionnaire has been filed and inquires how the matter will be proceeding.  Atty. Kuhary advises his client is prepared to proceed with plea and sentencing.  State recites the offer.  Court notes there is no PAC Count.  Atty. Kuhary advises he has an amended information that includes that Count.  State confirms there is an amended information and files it with the Court.  Atty. Kuhary acknowledges receipt of the amended information, waives reading and enters initial not guilty plea as to Count 2.  State continues to recite the offer.  Atty. Kuhary confirms the offer.  Court conducts plea colloquy with the defendant.  Defendant enters a guilty plea to Count 1, Court finds defendant guilty of Count 1.  Court orders Count 2 dismissed by operation of law.

Sentencing arguments made by the State.
Sentencing arguments made by Atty. Kuhary.
Defendant presents statements.

COUNT 1:
The Court Orders the Following:

Withheld sentence (Court will award 3 Days Credit IF defendant is revoked and sentenced)

Term of Probation: 2 Years

Conditions of Probation:
-	AODA Assessment and follow through with any treatment recommended;
-	Absolute Sobriety; Random U.A.s;
-	No Use or Possession of alcohol or illegal drugs;
-	No Use or Possession of CBD products;
-	No use or possession of any controlled substances without a valid doctors prescription
-	No use of possession of vaping products;
-	Attend Victim Impact Panel;
-	No operation of a motor vehicle without a valid driver's license;
-	Comply with all rules of OWI Treatment Court and remain in good standing.

Condition Time: 300 Days Huber with NON WORKING HOURS WITH STANDARD RELEASE CONDITIONS - To commence forthwith. 

DL REVOCATION:  33 months.

IGNITITION INTERLOCK: 33 months.

FINE:  $2073.00;

DNA Surcharge: $250.00;

DNA Sample ordered and to be provided immediately if in custody or within (3) business days at the Waukesha County Sheriff Department. 

BLOOD DRAW FEE:  $35.00 to be paid through Waukesha County Circuit Court to be forwarded to Waukesha County Sheriff Department.

Total costs/fine/forfeiture:  to be paid as a condition of probation. Failure to pay;  will result in a civil judgment.

Felony warnings, immigration warnings, voting rights and firearms warnings given.
